import { styled } from 'styled-components'

const StyledBox = styled.section`
  background-color: #233945;
  width: 80%;
  color: #FFFFFF;
  box-sizing: border-box;
  height: 80%;
  overflow: hidden;
  display: flex;
  flex-direction: column;
  border-radius: 10px;
`

const StyledTitle = styled.div`
  font-size: 2em;
  font-weight: bold;
  border-left: 2px solid #345363;
  border-right: 2px solid #345363;
  border-top: 2px solid #345363;
  padding: 10px;
  flex-shrink: 0;
`

const StyledImageBox = styled.div`
  border: 2px solid #345363;
  padding: 10px;
  flex-grow: 1;
  flex-shrink: 1;
`

const StyledImage = styled.img`
  height: 90%;
  width: auto;
`

const ImageBox = ({ objectClass, image }) => {
  return (
    <>
      <StyledBox>
        <StyledTitle>{objectClass}</StyledTitle>
        <StyledImageBox><StyledImage src={image} /></StyledImageBox>
      </StyledBox>
    </>
  )
}

export default ImageBox
